function varargout = MEC_2_LD_1_a_g_2_JS_MSB_MM2_g3_a_matlab(varargin) 

t = varargin{1};
theta = varargin{2};
if(nargin>=3)
    kappa=varargin{3};
   if(length(kappa)==0)
    kappa(1:700)=0;
   end
else
    kappa = zeros(1,700);
end
% Initial conditions
x0 = x0fun(theta,kappa);

% Simulation
[tout,X] = ode15s(@(t,x) rhs(t,x,theta,kappa),t,x0);
Y = rhsO(t,X,theta,kappa);

% Assign output
varargout{1} = tout;
if nargout >= 2
varargout{2} = X;
end
if nargout >= 3
    varargout{3} = Y;
end
if nargout >= 4
    error('Too many output arguments.');
end


